import Project from './Project';
import './style.css';

function Work() {

   // Recipe Generator
   const recipeGenerator = {
      id: 1,
      title: 'Recipe Generator',
      mockupPath: '/assets/work/recipe/desktop-mockup.png',
      deployedLink: 'https://mreliwood.github.io/demo-recipe-generator/',
      repoLink: 'https://github.com/MrEliWood/demo-recipe-generator',
      team: [
         {
            name: 'Eli Wood',
            role: 'Project Manager'
         },
         {
            name: 'Hannah Callison',
            role: 'Git Admin'
         },
         {
            name: 'Joe Choe',
            role: ''
         },
         {
            name: 'Jonathan Tran',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'jQuery',
         'TheMealDB API',
         'TheCocktailDB API'
      ],
      time: '1 Week',
      description: `This recipe generator uses two external APIs (TheMealDB & TheCocktailDB) to generate random recipes for users who need al ittle inspiration in the kitchen. Users are able to refine their results with any combination of courses, filtering by appetizer, entree, dessert, or drinks. Additionally, the user is able to filter out recipes with specific ingredients, accommodating any dietary resrictions or strong dislikes.`,
      why: `For the people who enjoy cooking at home but need a little inspiration or some new ideas.`,
      how: `TheMealDB API allows the client to request a recipe at random. Combined with some complex filtering and conditional rendering, we're able to present the user with an intuitive and functional application.`
   }

   // Porefection
   const porefection = {
      id: 2,
      title: 'Porefect Skincare',
      mockupPath: '/assets/work/porefection/desktop-mockup.png',
      deployedLink: 'https://porefect.herokuapp.com',
      repoLink: 'https://github.com/jittel/combo-skincare',
      team: [
         {
            name: 'Isis Alexander',
            role: 'Project Manager'
         },
         {
            name: 'Nate Ginn',
            role: 'Git Admin'
         },
         {
            name: 'Eli Wood',
            role: ''
         },
         {
            name: 'Jaden Storey',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'node.js',
         'Express.js',
         'MySQL 2',
         'Sequelize',
         'bcrypt',
         'Cloudinary'
      ],
      time: '1 Week',
      description: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      why: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      how: `Logging in gives you the ability to go to the profile page, which is where most of the app's functionality exists. You can add a picture to your profile, and add various skincare products to your page, which get auto populated in the order they should be used in.`
   }

   // Weather Dashboard
   const weatherDashboard = {
      id: 2,
      title: 'Porefect Skincare',
      mockupPath: '/assets/work/porefection/desktop-mockup.png',
      deployedLink: 'https://porefect.herokuapp.com',
      repoLink: 'https://github.com/jittel/combo-skincare',
      team: [
         {
            name: 'Isis Alexander',
            role: 'Project Manager'
         },
         {
            name: 'Nate Ginn',
            role: 'Git Admin'
         },
         {
            name: 'Eli Wood',
            role: ''
         },
         {
            name: 'Jaden Storey',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'node.js',
         'Express.js',
         'MySQL 2',
         'Sequelize',
         'bcrypt',
         'Cloudinary'
      ],
      time: '1 Week',
      description: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      why: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      how: `Logging in gives you the ability to go to the profile page, which is where most of the app's functionality exists. You can add a picture to your profile, and add various skincare products to your page, which get auto populated in the order they should be used in.`
   }

   return (
      <div className="page">
         <Project project={recipeGenerator} />
         <Project project={porefection} />
      </div>
   );

}

export default Work;
